import {Routes, Route} from 'react-router-dom';
import Home from "./routes/home/home.component.jsx";

const Shop=()=>{
  return (
    <h1>I love Ingrid with all my heart and soul</h1>
  )
}

const App=()=>{
  return (
    <Routes>
      <Route path="/" element={<Home/>}>
        <Route path="shop" element={<Shop/>}/>
      </Route>
    </Routes>
  )
}

export default App;
